            <div class="color-box" id="#00a3e8" style="background-color: #00a3e8;">短居 0</div>

            <div class="color-box" id="#cacaca" style="background-color: #cacaca;">路过 0</div>
            <div class="color-box" id="#ffffff" style="background-color: #ffffff;">没去过 372</div>
        </div>
    </div>

    <script>
        let componentToHex = (val) => {
            const a = Number(val).toString(16);
            //        ^^^^^^^^^^^
            return a.length === 1 ? "0" + a : a;
        }
        let rgbtohex = (rgb) => {
            return '#' + rgb
                .match(/\d+/g)
                .map(componentToHex)
                .join('');
        }
    </script>
    <script>
        // 获取路径容器
        const svg = document.querySelectorAll('svg path');
        const pathNameDiv = document.getElementById('pathName');

        let chosen = {}
        let count = { '#ffffff': 372, '#ff0000': 0, '#a747a4': 0, '#00a3e8': 0, '#9ad9ea': 0, '#cacaca': 0, '#ffffff': 0 }
        count['#ffffff'] = 372
        // console.log(count)

        // 为每个路径添加事件监听
        svg.forEach(function (shape) {
            if (shape.getAttribute('data-dep') != '1') {
                return;
            }

            chosen[shape.getAttribute('name')] = '#ffffff'

            shape.addEventListener('mouseover', function (e) {
                if (e.target.tagName === 'path') {
                    const pathName = e.target.getAttribute('name');
                    if (pathName) {
                        pathNameDiv.textContent = pathName;
                        // const rect = e.target.getBBox();
                        // const centerX = rect.x + rect.width / 2;
                        // const centerY = rect.y + rect.height / 2;
                        // pathNameDiv.style.left = centerX + 'px';
                        // pathNameDiv.style.top = centerY + 'px';
                        // pathNameDiv.style.display = 'block';
                        if (e.target.tagName === 'path') {
                            e.target.style.fill = chosenColor
                        }
                    }
                }
            });
            shape.addEventListener('mouseout', function (e) {
                if (e.target.tagName === 'path' && chosen[e.target.getAttribute('name')] == '#ffffff') {
                    e.target.style.fill = '#ffffff'
                }
                if (chosen[e.target.getAttribute('name')]) {
                    e.target.style.fill = chosen[e.target.getAttribute('name')]
                }
            });

            shape.addEventListener('click', function (e) {
                if (chosenColor === '#d3d3d3') {
                    return
                }
                count[chosen[e.target.getAttribute('name')]] -= 1
                count[rgbtohex(chosenColor)] += 1
                e.target.style.fill = chosenColor
                chosen[e.target.getAttribute('name')] = rgbtohex(chosenColor)

                for(let key in count){
                    document.getElementById(key).innerText = document.getElementById(key).innerText.split(' ')[0] + ' ' + count[key]
                }
            });
        });


    </script>
    <script>
        const colors = document.querySelectorAll('.color-box')
        let chosenColor = '#d3d3d3'
        colors.forEach(function (c) {
            c.addEventListener('click', function (e) {
                chosenColor = e.target.style.backgroundColor
                // console.log('chosen', chosenColor)
                colors.forEach(function (c) {
                    c.style.fontWeight = 400
                    c.style.textDecoration = ''
                })
                e.target.style.fontWeight = 800
                e.target.style.textDecoration = 'underline'
                // console.log(chosenColor)
            });
        });
    </script>
    <script>
        function addPattern(c1, c2){
            document.getElementById('patterns').innerHTML += "<pattern id=\"diagonal3_" + c1 + "_" + c2 + "_preview\" width=\"10\" height=\"10\" patternUnits=\"userSpaceOnUse\"><rect width=\"10\" height=\"10\" fill=\"" + c1 + "\"></rect><path id=\"pattern1\" d=\"M-1,1 l2,-2 M0,10 l10,-10 M9,11 l2,-2\" stroke=\"" + c2 + "\" stroke-width=\"3\"></path></pattern>"
        }
    </script>
